    constructor() {
        super(...arguments);
        //define the array of JSON
        this.data1 = [
            { text: 'Birth plan', id: '1' },
            { text: 'Insurance card', id: '2' },
            { text: 'Photo ID', id: '3' },
            { text: 'Pregnancy medical record', id: '4' },
            { text: 'Your pediatrician\'s contact info', id: '5' },
        ];
        this.data2 = [
            { text: 'Do Meditation', id: '1' },
