            { text: 'Buy Groceries', id: '3' },
            { text: 'Pay Phone bill', id: '4' },
            { text: 'Play Football with your friends', id: '5' },
        ];
    }
    render() {
        return (
        // specifies the tag to render the ListView component
        <>
        <ListViewComponent id='list' dataSource={this.data1} showCheckBox={true} headerTitle='What the hospital will ask you for:' showHeader={true}></ListViewComponent>
